import axios from 'axios'
import React, { Component } from 'react'
import { Table } from 'react-bootstrap'
import { Apiurl } from '../services/apirest'

export  class MyRoutes extends Component {

    state = {
      data : []
    }

    username = localStorage.getItem("username");

    getRoutes = () => {
        let url = Apiurl + "/api/users/" + this.username + "/routes"
        axios.get(url)
        .then(res => {
            this.setState({data: res.data})
        })
      }

      componentDidMount() {
        this.getRoutes();
      }

  render() {
    return (
      <div>
        <h1>MyRoutes</h1>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>Line</th>
              <th>View</th>
              <th>Accion</th>
            </tr>
          </thead>
          <tbody>
            {this.state.data.map((Route) => {
              return (
                <tr>
                  <td>{Route.id}</td>
                  <td>{Route.name}</td>
                  <td> <a href={'/route/' + Route.id}>View</a> </td>
                  <td>
                    <button className="btn btn-success" style={{"margin-right": "10px"}}>Edit</button>
                    <button className="btn btn-danger">Disagree</button>
                  </td>
                </tr>
              )
            })}
          </tbody>
        </Table>
      </div>
    )
  }
}
